#!/usr/bin/env python3
import os
import json
import base64
import hashlib
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime
import sys

# === Fonctions de déchiffrement ===
def decrypt_data(encrypted_data, key):
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        print(f"❌ Erreur de déchiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    try:
        return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))
    except Exception as e:
        print(f"❌ Erreur de déchiffrement RSA: {e}")
        return None

# === Point d'entrée ===
if __name__ == "__main__":
    try:
        # Chargement des métadonnées
        try:
            with open(f"IPToP_1.4_encrypted.metadata.json") as f:
                metadata = json.load(f)
        except Exception as e:
            print(f"❌ Impossible de charger les métadonnées: {e}")
            sys.exit(1)
        
        # Vérification de la date d'expiration
        if datetime.now() > datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
            print("⌛ Script expiré")
            sys.exit(1)
        
        # Chargement de la clé privée
        try:
            with open("private_key.pem") as f:
                private_key = RSA.import_key(f.read())
        except Exception as e:
            print(f"❌ Impossible de charger la clé privée: {e}")
            sys.exit(1)
        
        # Déchiffrement de la clé AES
        aes_key = decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        if not aes_key:
            print("❌ Impossible de déchiffrer la clé AES")
            sys.exit(1)
        
        # Déchiffrement et exécution du script
        decrypted_script = decrypt_data(
            """""",
            aes_key
        )
        
        if decrypted_script:
            exec(decrypted_script)
        else:
            print("❌ Impossible de déchiffrer le script")
            sys.exit(1)
    except Exception as e:
        print(f"❌ Erreur critique: {str(e)}")
        sys.exit(1)
